import React, { useState } from 'react';
import {BrowserRouter, Routes, Route} from 'react-router-dom'
import Login from './components/Login';
// ...
const App = () => {
  

  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route path="/" element={<Login/>} />
      </Routes>
      </BrowserRouter>
    </div>  
  );
};

export default App;
